import { image1, image2, image3, image4 } from './imag'


export default function Header() {
    return (
        <div>
            <img src="data:image/png;base64," alt="hair" />
            <img src="data:image/png;base64," alt="hair" />
            <img src="data:image/jpeg;base64," alt="hair" />
            <img src="data:image/png;base64," alt="hair" />
        </div>
    )
}
